function Getkyc(n,t,i){var r=GetSearchParam(n,t,i);HttpPost(`/InternalKycForm/List`,"html",r,function(n){$("#divkycTable").html("");$("#divkycTable").html(n)})}function GetSearchParam(n,t,i){return{Mobileno:"",Id:$("#txtId").val(),property:$("#txtName").val(),Fileno:$("#txtFileNo").val(),zone:$("#txtZone").val(),locality:$("#txtLocality").val(),PlotNo:$("#txtPlot").val(),sortBy:$("#ddlSort").children("option:selected").val(),sortOrder:parseInt(i),pageSize:parseInt(t),pageNumber:parseInt(n)}}function onPaging(n){Getkyc(parseInt(n),parseInt(currentPageSize),sortOrder);currentPageNumber=n}function onChangePageSize(n){Getkyc(parseInt(currentPageNumber),parseInt(n),sortOrder);currentPageSize=n}var currentPageNumber=1,currentPageSize=5,sortOrder=1;$(document).ready(function(){Getkyc(currentPageNumber,currentPageSize,sortOrder)});$("#btnSearch").click(function(){Getkyc(currentPageNumber,currentPageSize,sortOrder)});$("#btnReset").click(function(){$("#txtId").val("");$("#txtName").val("");$("#txtFileNo").val("");$("#txtZone").val("");$("#txtLocality").val("");$("#txtPlot").val("");Getkyc(currentPageNumber,currentPageSize,sortOrder)});$("#btnAscending").click(function(){$("#btnDescending").removeClass("active");$("#btnAscending").addClass("active");sortOrder=1;Getkyc(currentPageNumber,currentPageSize,sortOrder)});$("#btnDescending").click(function(){$("#btnAscending").removeClass("active");$("#btnDescending").addClass("active");sortOrder=2;Getkyc(currentPageNumber,currentPageSize,sortOrder)});$("#ddlSort").change(function(){Getkyc(currentPageNumber,currentPageSize,sortOrder)});